// HasNics applies the HasEdge predicate on the "nics" edge.
func HasNics() predicate.BronzeS1Agent {
	return predicate.BronzeS1Agent(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, NicsTable, NicsColumn),
		)
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.BronzeS1AgentNIC
		step.Edge.Schema = schemaConfig.BronzeS1AgentNIC
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasNicsWith applies the HasEdge predicate on the "nics" edge with a given conditions (other predicates).
func HasNicsWith(preds ...predicate.BronzeS1AgentNIC) predicate.BronzeS1Agent {
	return predicate.BronzeS1Agent(func(s *sql.Selector) {
		step := newNicsStep()
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.BronzeS1AgentNIC
		step.Edge.Schema = schemaConfig.BronzeS1AgentNIC
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

